import React from 'react';
import Project from './Project';
import { data } from '../data';

const Projects = () => {  

  return (
    <section>
      {data.map(item => {
        return (
          <Project
            key={item.id}
            image={item.image}
            name={item.name}
            link={item.link}
          />
        )
      })}
    </section>
  );
}

export default Projects;
